={{((parameters) => {
    const mode = parameters.mode;
    if (mode === 'expression') {
        return Array.from({ length: parameters.numberOutputs }, (_, i) => ({
            type: `${"main"}`,
            displayName: i.toString(),
        }));
    }
    else {
        const rules = parameters.rules?.values ?? [];
        const ruleOutputs = rules.map((rule, index) => {
            return {
                type: `${"main"}`,
                displayName: rule.outputKey || index.toString(),
            };
        });
        if (parameters.options?.fallbackOutput === 'extra') {
            const renameFallbackOutput = parameters.options?.renameFallbackOutput;
            ruleOutputs.push({
                type: `${"main"}`,
                displayName: renameFallbackOutput || 'Fallback',
            });
        }
        return ruleOutputs;
    }
})($parameter)}}

={{((parameters, defaultCategories) => {
    const options = (parameters?.options ?? {});
    const categories = options?.categories ?? defaultCategories;
    const categoriesArray = categories.split(',').map((cat) => cat.trim());
    const ret = categoriesArray.map((cat) => ({ type: "main", displayName: cat }));
    return ret;
})($parameter, "Positive, Neutral, Negative")}}

={{((parameters) => {
    const categories = parameters.categories?.categories ?? [];
    const fallback = parameters.options?.fallback;
    const ret = categories.map((cat) => {
        return { type: "main", displayName: cat.category };
    });
    if (fallback === 'other')
        ret.push({ type: "main", displayName: 'Other' });
    return ret;
})($parameter)}}

